import React from "react";
import { Jumbotron, Container } from "reactstrap";
import styled, { keyframes } from "styled-components";
import Pulse from "@bit/formidablelabs.react-animations.pulse";

const PulseAnimation = keyframes`${Pulse}`;
const PulseDiv = styled.div`
  animation: infinite 5s ${PulseAnimation};
`;

const Padding = styled.div`
  width: 80%;
  margin: 1% auto;
`;

const BodyComp = props => {
  return (
    <Padding>
      <Jumbotron fluid>
        <Container fluid>
          <PulseDiv>
            <h1 className="rotateInDownLeft">Chill, it's just an App</h1>
            <p className="roateInDownRight">
              Are you having a strong REACTion to how awesome this app is,
              considering the builder though a library was just that really cool
              place with all of the books two weeks ago? I don't blame you but
              you have to chill, it's just an app!
            </p>
          </PulseDiv>
        </Container>
      </Jumbotron>
    </Padding>
  );
};

export default BodyComp;
